export default class APIService {
    static UpdateArticle(article_id, body) {
        return fetch(`http://localhost:8000/api-auth/login/`,
            {
                "method": "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(body)
            }).then(resp => resp.json())
    }
}
